import React, { useEffect, useState } from 'react'
import "./Home.css"
function Home() {
  const [tarifler,setTarifler] = useState(null);

  useEffect(()=>{
    fetch("http://localhost:3000/tarifler")
    .then(res => res.json())
    .then(data =>setTarifler(data))
  },[]);

  return (
    <div className="row mt-3">
      {
        tarifler?.map()
      }
    </div>
  )
}

export default Home
